post_text:
Columbus Weekend Events:
Friday:
Parade leaves school for North Street.
The Bonfire will begin at approximately 7 (be there early in case the fire gets going early).
Following the team introductions the alumni soccer game will commence.

Saturday and Sunday:
Games are scheduled for 1pm, 3pm, 5pm and 7pm
Saturday games:
@1pm Waterville vs. Remsen
@3pm Blessed Virgin Mary vs. ADK
@5pm Warrensburg vs. TOWUFSD
@7pm UAS vs. TOWUFSD
Sunday games:
@1pm Girls Consolation Game
@3pm Boys Consolation Game
@5pm Girls Championship Game
@7pm Boys Championship Game

Come support our students and student athlete through your attendance and positive and encouraging sideline engagement. Concessions will also be available for you to help support the students in their fundraising activities.

Remember to make good decisions, employ good sportsmanship and spectator behavior, have fun and be SAFE this weekend!

GO ESKIMOS!!

